import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-error404',
  templateUrl: './error404.page.html',
  styleUrls: ['./error404.page.scss'],
})
export class Error404Page implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<!-- error404.page.html -->
<ion-header>
  <ion-toolbar>
    <ion-title>
      Página no encontrada
    </ion-title>
  </ion-toolbar>
</ion-header>

<ion-content class="ion-padding">
  <p>Lo siento, la página que estás buscando no existe.</p>
  <p>Error 404</p>
  <!-- Puedes agregar enlaces u otros elementos según tus necesidades -->
</ion-content>
